import React, { useState, useEffect } from "react";
import axios from "axios";
const Blogs = () => {
  const [blogs, setBlogs] = useState([]);

  const getAllBlogs = async () => {
    try {
      const { data } = await axios.get("/api/v1/blog/all-blog");
      if (data?.success) {
        setBlogs(data.blogs);
      }
    } catch (err) {
      console.log(err);
    }
  };
  return <div></div>;
};

export default Blogs;
